import React from 'react';

import { useParams } from 'react-router-dom';

import LoremIpsum from 'react-lorem-ipsum';

export default function Resort(props) {
   const { resortQuery } = useParams();
   // console.log(resortQuery);
   console.log(props.resorts);
   // console.log(props.resorts.find(resort => resort.skiMapID === resortQuery));
   // const skiMapID = props.resorts.find(resort => resort.skiMapID === resortQuery).skiMapID;

   let [resortData, setResortData] = React.useState({});
   const corsProxy = 'https://mighty-scrubland-75189.herokuapp.com';

   React.useEffect(() => {
      fetch(`${corsProxy}/https://liftie.info/api/resort/${props.resort.query}`)
         .then(response => response.json())
         .then(data => {
            setResortData(data);
            console.log(resortData);
         })
         .catch((error) => {
            console.log(`Encountered error in Liftie Fetch request: ${error}`)
         });
   }, [])

   return (
      <>
         <div>You clicked on this ski resort: {resortData.name}</div>
         {/* <LoremIpsum p={12}></LoremIpsum> */}
      </>
   );
}
